import React from 'react';
import PropTypes from 'prop-types';

function Food({ name, picture, rating }) {
  return (
    <>
      <h1>I love {name}!! </h1>
      <h4>{rating}/5</h4>
      <img src={picture} alt={name} />
    </>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

const foodILike = [
  {
    id: 1,
    name: 'kimchi',
    image:
      'data:image/jpeg;base64,',
    rating: 4.8,
  },
  {
    id: 2,
    name: 'ramen',
    image:
      'data:image/jpeg;base64,',
    rating: 4.5,
  },
  {
    id: 3,
    name: 'chicken',
    image:
      'data:image/jpeg;base64,',
    rating: 4.9,
  },
];

function App() {
  return (
    <>
      <div>
        {foodILike.map((item) => (
          <Food
            key={item.id}
            name={item.name}
            picture={item.image}
            rating={item.rating}
          />
        ))}
      </div>
    </>
  );
}

export default App;
